import React from 'react';
import './App.css';

const images = 'https://image.tmdb.org/t/p/w500';

function reUsableComponent(props) {
	let info = props.info;
	return info.map((movie) => {
		return (
			<div key={movie.id} className='movieContent'>
				<img className='images' src={`${images}${movie.poster_path}`}></img>
			</div>
		);
	});
}

export default reUsableComponent;
